import { Box } from "@mui/material";
import React from "react";

export default function AttachFilesModal() {
  return (
    <Box
      sx={{
        width: "500px",
        height: "90%",
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        backgroundColor: "#121212",
        borderRadius: "10px",
        boxShadow: "#fff 0px 0px 20px -12px inset, rgba(0, 0, 0, 0.3) 0px 18px 36px -18px inset",
        padding: "10px 10px",
      }}
    >
        Send Post
    </Box>
  );
}
